import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import About from './components/About';
import Home from './components/Home';
import Card from './components/Card';
import Page1 from './components/Page1'; // Import Page1 component
import Page2 from './components/Page2'; // Import Page2 component
import Page3 from './components/Page3'; // Import Page3 component
import Page4 from './components/Page4'; // Import Page4 component
import Page5 from './components/Page5'; // Import Page5 component
// import Query from './components/ProductQueryForm';
// import Login from './components/Login';
// import Register from './components/Register';
// import Catal from './Catal';

function App() {
  return (
    <Router>
      <div className="app-container">
        <Routes>
          <Route path="/" element={<Home />} />
          {/* <Route path="/register" element={<Register />} /> */}
          <Route path="/about" element={<About />} />
          <Route path="/card" element={<Card />} />
          <Route path="/page1" element={<Page1 />} /> {/* Add route for Page1 */}
          <Route path="/page2" element={<Page2 />} /> {/* Add route for Page2 */}
          <Route path="/page3" element={<Page3 />} /> {/* Add route for Page3 */}
          <Route path="/page4" element={<Page4 />} /> {/* Add route for Page4 */}
          <Route path="/page5" element={<Page5 />} /> {/* Add route for Page5 */}
          {/* <Route path="/query" element={<Query />} />  */}
          {/* <Route path="/login" element={<Login />}/> */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
